''' ''Nota: Wikipedia bahasa Melayu menyarankan anda menggunakan kata pemeri dengan tepat dalam setiap penyuntingan.'''''
{{Tatabahasa}}
'''Kata pemeri''' ialah kata yang yang bertugas memeri hal atau merangkaikan [[frasa]] utama dalam [[predikat]] dengan frasa [[subjek]] dan sebagai pemisah antara subjek dengan predikat ayat. Dengan kata lain, frasa yang hadir sebelum kata pemeri ialah subjek ayat sementara frasa yang hadir selepas kata pemeri ialah predikat ayat. Terdapat dua jenis kata pemeri, iaitu ''ialah'' dan ''adalah''. Kata pemeri tergolong dalam [[kata tugas]].

'''Titan''' (atau '''Zuhal VI''') ialah [[satelit semulajadi|bulan]] [[Zuhal]] yang terbesar. Ia merupakan satu-satunya bulan di dalam [[sistem suria]] yang mempunyai lapisan [[atmosfera]] dan satu-satunya objek sistem suria yang diketahui mempunyai cecair di permukaannya, selain [[Bumi]].
Titan ialah bulan keenam Zuhal. Ia sering digambarkan sebagai sebuah bulan planet kerana saiznya yang besar; 50% lebih besar dan 80% lebih berjisim daripada [[Bulan (satelit)|bulan Bumi]]. Titan ialah [[senarai satelit semulajadi mengikut diameter|bulan kedua terbesar]] dalam sistem suria (didahului oleh bulan [[Musytari]], [[Ganymede]]), dan adalah lebih besar dari segi isipadu daripada planet terkecil, Utarid, tetapi kurang berjisim. Titan ialah bulan Zuhal yang pertama dan satelit semulajadi yang kelima (dikecualikan Bulan) yang ditemui. Ia telah ditemui oleh ahli falak Belanda, [[Christiaan Huygens]] pada 1655.
